"""
Given two strings s and t, you want to transform string s into string t using the following operation any number of times:

Choose a non-empty substring in s and sort it in-place so the characters are in ascending order.
For example, applying the operation on the underlined substring in "14234" results in "12344".

Return true if it is possible to transform string s into string t. Otherwise, return false.

A substring is a contiguous sequence of characters within a string.
"""
from tqdm import trange


class Solution:
    def curr(self, a: list, b: int) -> list:
        cur_list = []
        s = a.copy()
        for i in trange(len(s)):
            if a[i] == b:
                cur_list.append(i)
        return cur_list

    def isTransformable(self, s: str, t: str) -> bool:
        if s == t:
            return True

        list_s = []
        list_t = []


        # The length of two string doesn't match
        if len(list_s) != len(list_t):
            return False

        for d in s:
            list_s.append(int(d))

        print(len(s))

        for bound in range(9):
            cur_s = self.curr(list_s, bound)
            cur_t = self.curr(list_t, bound)
            if len(cur_s) == len(cur_t) == 0:
                continue
            elif len(cur_s) != len(cur_t):
                return False

            for i in range(len(cur_s)):
                if cur_s[i] < cur_t[i]:
                    return False
        return True


if __name__ == '__main__':
    sol = Solution()

    a = ""
    b = ""
    print(sol.isTransformable(a, b))
